Notifica-se a pessoa jurídica sobre a entrega dos laudos de análise de produtos coletados neste estabelecimento:
1. laudo de análise 241.1P.0/2023 do produto "sal", marca Lebre, lote 110543 com parecer satisfatório;
2. laudo de análise 242.1P.0/2023 do produto "queijo parmesão ralado", marca Itambé, lote 0215, com parecer insatisfatório para análise de rótulo e determinação de sódio - maior que o declarado.
